    const dispatch = useDispatch()
    // const registration = useSelector(state => state.registration.registration)

    const func = (param: any) => {

        interface addRegisterProps{
            formRegisterConfig: formConfigIterface[]
        }

        const addRegister = (name:string, email:string, password:string) => {
            const userInfo = {
                name,
                email,
                password
            }
            dispatch(action_ADD_Register(userInfo))
        }
        console.log('param', param)
    }


    return(

        <form className="registration-form">
            <h1 className="registration-form__heading">Register</h1>

            <FormBuilder 
                formConfig={formRegisterConfig}
                func={func}
                // registerValue={registerValue}
                // addRegister= {addRegister}
            />


        </form>
    )
}

export default RegistrationForm
